import './Sidebar.scss';

export const Sidebar = props => {
  return (
    <div className="sidebar">
      <h2>Image of the Week</h2>
      <img width="100%" src={process.env.PUBLIC_URL + '/image.png'} />
      <button className="btn btn-primary">See More</button>
    </div>
  );
}

export default Sidebar
